/* ---- /143TbAqxkbJsYtLnMSkAKjyJoQmFhp1cDR/js/ZZ_main.js ---- */


const theColors = {
    red: '#e50000',
    orange: '#e59500',
    brown: '#a06a42',
    yellow: '#e5d900',
    lightgreen: '#94E044',
    green: '#02BE01',
    bmo: '#5ECEB7',
    celeste: '#00D3DD',
    cyan: '#0083C7',
    blue: '#0000EA',
    pink: '#CF6EE4',
    darkpink: '#820080',
    lightpink: '#FFA7D1',
    white: '#FFFFFF',
    lightgrey: '#E4E4E4',
    grey: '#888888',
    black: '#222222'
}

const h = maquette.h;
const projector = maquette.createProjector();
const status = {
    'color': theColors.red,
    'miners': [],
    'miningPool': maquette.createMapping((e) => e.id, e => e, (updatedSource, target) => {}),
    addMiner: function(miner) {
        this.miners.push(miner);
        this.miningPool.map(this.miners);
        projector.scheduleRender();
        return miner;
    },
    removeMiner: function(miner) {
        this.miners = this.miners.filter(e => e.id != miner.id);
        this.miningPool.map(this.miners);
        projector.scheduleRender();
        return miner;
    },
    user: { used_space: 0 }
};
var canvas, toolBar;
var mineDialog = null;
var mining = null;

function closeDialog() {
    mineDialog = null;
    canvas.blur(false);
    projector.scheduleRender();
}

function selectUserHandler(e){
    return page.selectUser();
}

function userInfo() {
    return h('span#used_space.text', {onclick:selectUserHandler}, `${status.user.used_space}% of your personal space used`)
}

function renderMaquette() {
    return h('bloxelWars', {}, [
        h('div.content', { classes: { inactive: mineDialog } }, [
            h('div#title', {}, "BloxelWars!"),
            h('div#moto', {}, "\"it's not the right time yet\" Beta"),
            h('div#user_info', {}, userInfo()),
            toolBar.renderMaquette(),
            h("div#miners", status.miningPool.results.map(e => e.renderMaquette()))
        ]),

        h('div.center-content', {
                classes: { invisible: !mineDialog },
                onclick: closeDialog
            },
            mineDialog ? mineDialog.renderMaquette() : null)

    ]);
}

document.addEventListener('DOMContentLoaded', function() {

    canvas = new PixiCanvas();
    toolBar = new ToolBar();
    projector.append(document.body, renderMaquette);
});



/* ---- /143TbAqxkbJsYtLnMSkAKjyJoQmFhp1cDR/js/ZeroPlace.js ---- */


class Page extends ZeroFrame {
    setSiteInfo(site_info) {
        console.log(site_info);
        this.site_info = site_info;
        if (site_info.event) this.processEvent(site_info.event);
        this.getUserDataRules();
    }

    processEvent(event) {
        var event = { type: event[0], value: event[1] };
        if (event.type == "file_done" && (event.value.indexOf("data.json")!==-1 || event.value.indexOf("blockchain.json")!==-1) ) {
            // data.json de usuario recibido
            canvas.refresh();
        }
    }

    onOpenWebsocket() {
        this.getBlockchain((blockchain) => {
            this.cmd("siteInfo", [], (site_info) => {
                this.setSiteInfo(site_info)
                this.cleanUpUserData(blockchain);
                canvas.refresh();
            })
        });
    }

    onRequest(cmd, message) {
        console.log(cmd, message);
        if (cmd == "setSiteInfo")
            this.setSiteInfo(message.params)
        else
            console.log("Unknown incoming message:", cmd)
    }

    selectUser() {
        this.cmd("certSelect", { "accepted_domains": ["zeroid.bit","kaffie.bit"] });
        return false;
    }

    getUserDataRules() {
        if (!this.site_info.cert_user_id) return;
        var data_inner_path = "data/users/" + this.site_info.auth_address + "/content.json";
        this.cmd("fileRules", [data_inner_path], (res) => {
            let free = res.max_size - res.current_size;
            let used = res.current_size / free * 100;
            status.user.used_space = used.toFixed();
            projector.scheduleRender();
            console.log(`using ${res.current_size} of ${res.max_size}. [${used.toFixed()}%] used.`)
        });
    }

    getBlockchain(done) {
        var data_inner_path = "data/blockchain.json";
        this.cmd("fileGet", [data_inner_path], (res) => {
            this.blockchain = JSON.parse(res);
            this.blockchain.bloxels.sort((a, b) => { return a.time - b.time });
            done(this.blockchain);
        });
    }

    cleanUpUserData(blockchain) {
        if (!this.site_info.cert_user_id) return;

        let now = +new Date();
        var data_inner_path = "data/users/" + this.site_info.auth_address + "/data.json";

        this.cmd("fileGet", { "inner_path": data_inner_path, "required": false }, (data) => {
            if (data) // Parse current data file
                data = JSON.parse(data)
            else // Not exists yet, use default data
                data = { created: now, bloxels: [] };

            let changed = data.bloxels.length;
            let blockchain_ids = blockchain.bloxels.map(e => e.solution)
            data.bloxels = data.bloxels.filter(b => {
                // user only keeps bloxels not in blockchain yet
                return blockchain_ids.indexOf(b.solution) === -1
            })

            if (data.bloxels.length == changed) return; // no changes
            data.updated = now;
            this.saveData(data);
        })

    }

    resetUserData() {
        if (!this.site_info.cert_user_id) return this.selectUser();

        let now = +new Date();
        let data = { created: now, bloxels: [] };
        this.saveData(data);
    }

    saveData(data) {
        var data_inner_path = "data/users/" + this.site_info.auth_address + "/data.json";
        var content_inner_path = "data/users/" + this.site_info.auth_address + "/content.json";

        var json_raw = unescape(encodeURIComponent(JSON.stringify(data, undefined, '\t')));
        this.cmd("fileWrite", [data_inner_path, btoa(json_raw)], (res) => {
            this.cmd("siteSign", { "inner_path": content_inner_path }, (res) => {
                if (res == "ok") {
                    this.cmd("sitePublish", { "inner_path": content_inner_path, "sign": false });
                }
            })
        })
    }
    signData() {
        var data_inner_path = "data/users/" + this.site_info.auth_address + "/data.json";
        var content_inner_path = "data/users/" + this.site_info.auth_address + "/content.json";
        this.cmd("fileGet", { "inner_path": data_inner_path, "required": false }, (data) => {
            this.saveData(JSON.parse(data));
        })
    }

    setBloxel(bloxel, done = () => { console.log('No callback defined in setBloxel') }) {
        if (!this.site_info) {
            this.cmd("wrapperNotification", ["error", "site info not loaded yet!"]);
            return false;
        }

        if (!this.site_info.cert_user_id) return this.selectUser();

        // This is our data file path
        var data_inner_path = "data/users/" + this.site_info.auth_address + "/data.json";
        var content_inner_path = "data/users/" + this.site_info.auth_address + "/content.json";

        let now = +new Date();

        this.cmd("fileGet", { "inner_path": data_inner_path, "required": false }, (data) => {
            if (data) // Parse current data file
                data = JSON.parse(data)
            else // Not exists yet, use default data
                data = { created: now, bloxels: [] };

            // Add the new bloxel
            data.bloxels.push(bloxel);
            data.updated = now;

            // Encode data array to utf8 json text
            var json_raw = unescape(encodeURIComponent(JSON.stringify(data, undefined, '\t')));

            // Write file to disk
            this.cmd("fileWrite", [data_inner_path, btoa(json_raw)], (res) => {
                if (res == "ok") {
                    // Sign the changed file in our user's directory
                    this.cmd("siteSign", { "inner_path": content_inner_path }, (res) => {
                        // Publish to other users
                        if (res == "ok") {
                            this.cmd("sitePublish", { "inner_path": content_inner_path, "sign": false });
                            done(bloxel);
                        } else {
                            console.log(res)
                        }
                    })
                } else {
                    this.cmd("wrapperNotification", ["error", "File write error: #{res}"])
                }
            })
        })

        return false;
    }

}
