class PixiCanvas {
    constructor() {
        this.pixelSize = 8;
        this.scale = 1;

        this.dragging = false;
        this.click = { button: false }
        this.clicked = false;

        let base = parseInt((window.innerWidth / 100) * 80);
        let width = base;
        let height = parseInt(base / 2);

        //Create the renderer
        this.app = new PIXI.Application({ width, height, antialias: false, transparent: true, resolution: 1, forceCanvas: false });
        this.app.ticker.speed = 0.1;

        //Add the canvas to the HTML document
        this.app.view.id = "theScreen";
        document.body.appendChild(this.app.view);


        //Create a container object
        this.container = new PIXI.Container();
        this.container.interactive = true;
        this.container.buttonMode = true;
        this.graphics = new PIXI.Graphics();
        this.blurFilter = new PIXI.filters.BlurFilter();

        this.container.addChild(this.graphics);
        this.app.stage.addChild(this.container);

        this.container.on("pointerdown", this.onDown.bind(this));
        this.container.on('pointermove', this.onMove.bind(this));
        this.container.on('pointerup', this.onUp.bind(this));

        this.app.stop();
        console.log("stop")
    }
    blur(turnOn) {
        if (turnOn) this.graphics.filters = [this.blurFilter];
        else this.graphics.filters = [];

        this.app.start();
        this.app.render();
        this.app.stop();
    }


    clickOnCanvas(e) {
        let x = e.data.originalEvent.clientX;
        let y = e.data.originalEvent.clientY;

        var bodyRect = document.body.getBoundingClientRect(),
            elemRect = this.app.view.getBoundingClientRect(),
            offset_top = elemRect.top - bodyRect.top,
            offset_left = elemRect.left - bodyRect.left;

        console.log(`canvas is offset top ${offset_top}, ${offset_left}`)
        return true;
    }

    onDown(e) {
        if (mineDialog != null) return;
        let button = e.data.originalEvent.button;
        //console.log("down!", button, e);
        this.dragging = false;
        this.click = { x: e.data.global.x, y: e.data.global.y, button: button };
        this.clicked = true;
        this.app.start();
        console.log("start")
        return false;
    }
    onUp(e) {

        if (mineDialog != null || !this.clicked) return;
        //console.log(`up! `, e)
        let button = e.data.originalEvent.button;
        if (button == 2 && this.dragging == false) {
            // right click
            this.toggleZoom(e.data.global)
        }
        if (button == 0 && this.dragging == false) {
            // left click
            let grid = this.screenToGrid(e.data.global.x, e.data.global.y);
            this.selectBloxel(grid.x, grid.y);

        }
        this.click = { button: false };
        this.dragging = false;
        this.clicked = false;
        if (button == 0) {
            console.log("stop")
            this.app.stop();
        }
    }
    onMove(e) {
        //    console.log(`move!`, e)
        if (this.click.button == 0 && this.click && !this.dragging) {
            let pos = e.data.global;
            if (Math.abs(this.click.x - pos.x) > 5 || Math.abs(this.click.y - pos.y) > 5) {
                this.dragging = true;
                this.graphicsStart = { x: this.container.position.x, y: this.container.position.y }
                //console.log("dragging!", this.graphicsStart);
            }
        }
        if (this.dragging) {
            this.container.position.x = ((e.data.global.x - this.click.x)) + this.graphicsStart.x;
            this.container.position.y = ((e.data.global.y - this.click.y)) + this.graphicsStart.y;
        }
    }
    screenToGrid(x, y) {
        let scale = this.container.scale.x;
        let grid = { x, y };
        let transX = x - this.container.position.x;
        let transY = y - this.container.position.y;

        grid.x = parseInt(transX / (this.pixelSize * scale));
        grid.y = parseInt(transY / (this.pixelSize * scale));

        //console.log(`scale:${scale} x:${x} y:${y} => ${JSON.stringify(grid)}`);

        return grid;
    }
    toggleZoom(offset) {
        let view_width = this.app.renderer.view.width;
        let view_height = this.app.renderer.view.height;

        let grid = this.screenToGrid(offset.x, offset.y);
        var scale = this.container.scale.x > 1 ? 1 : 8;
        var currentScale = this.container.scale.x;

        var newX = (view_width / 2) - ((this.pixelSize * scale) / 2) - (this.pixelSize * grid.x * scale);
        var newY = (view_height / 2) - ((this.pixelSize * scale) / 2) - (this.pixelSize * grid.y * scale)

        var completed = () => {
            this.render(this.bloxels);
            console.log("stop")
        }
        TweenMax.to(this.container.scale, 0.5, { x: scale, y: scale, ease: Power3.easeInOut, onComplete: completed });
        TweenMax.to(this.container.position, 0.5, { x: newX, y: newY, ease: Power3.easeInOut });
    }

    drawPixel(x = 0, y = 0, color = "#FFFFFF") {
        let ps = this.pixelSize;
        var scale = this.container.scale.x > 1 ? 1 : 8;

        var hexColor = parseInt(color.replace(/^#/, ''), 16);
        if (color == "grey") hexColor = 0x808080;
        this.graphics.beginFill(hexColor);
        this.graphics.lineStyle(scale > 1 ? 0 : 1, 0x999999, 1);
        this.graphics.drawRect(x * ps, y * ps, ps, ps);
        this.graphics.endFill();
    }
    selectBloxel(x, y) {
        if (!page.site_info.cert_user_id) return page.selectUser();

        DB.getBloxel(x, y, (bloxel) => {
            let xpoint = (x * this.pixelSize) + this.pixelSize / 2;
            let ypoint = (y * this.pixelSize) + this.pixelSize / 2;

            mineDialog = new Dialog(bloxel, { img: this.takeShot(xpoint, ypoint, this.pixelSize * 2, this.pixelSize * 2) });
            projector.scheduleRender();
        })
    }
    takeShot(x, y, w = 64, h = 64) {
        var oldScale = this.container.scale.x;
        var oldX = this.container.position.x;
        var oldY = this.container.position.y;

        this.container.scale.set(1, 1)
        this.container.position.set(0, 0);
        var renderTexture = PIXI.RenderTexture.create(this.container.width, this.container.height);
        this.app.renderer.render(this.container, renderTexture);

        let rect_x = x - w / 2;
        let rect_y = y - h / 2;
        if (rect_x + w > this.container.width) w = w - ((rect_x + w) - this.container.width);
        if (rect_y + h > this.container.height) h = h - ((rect_y + h) - this.container.height);
        renderTexture.setFrame(new PIXI.Rectangle(rect_x, rect_y, w, h))
        var canvas = this.app.renderer.extract.canvas(renderTexture);

        this.container.scale.set(oldScale, oldScale);
        this.container.position.set(oldX, oldY);
        return canvas.toDataURL('image/png');
    }

    render(bloxels) {
        console.log("render start")
        bloxels.forEach(b => this.drawPixel(b.x, b.y, b.color))
        this.app.start();
        this.app.render();
        this.app.stop();
        console.log("render end")
    }
    refresh() {
        DB.getBloxels(bloxels => {
            this.bloxels = bloxels;
            this.render(bloxels);
        });
    }
}



/* ---- /143TbAqxkbJsYtLnMSkAKjyJoQmFhp1cDR/js/db.js ---- */


var DB = {
    getBloxels(done) {
        /*
          let query = `select b.*, _b.time+b.offset AS check_time, _b.seq+1 as check_seq, max(b.seq) as max_seq
                      from bloxels as b left join bloxels as _b on b.parent=_b.solution
                      where b.time==1491324000376 OR ((check_time==b.time) AND (b.seq==check_seq))
                      group by b.x,b.y order by x,y,seq, offset desc, b.time asc;`;
                      */
        let query = `select b.*, _b.time+b.offset AS check_time, _b.seq+1 as check_seq
                    from bloxels as b left join bloxels as _b on b.parent=_b.solution
                    where b.time==1491324000376 OR ((check_time==b.time) AND (b.seq==check_seq))
                    order by x,y,seq, offset desc, b.time asc;`;

        page.cmd("dbQuery", [query], function(bloxels) {
            bloxels = bloxels.filter(b => checkBloxel(b));
            bloxels = page.blockchain.bloxels.concat(bloxels);
            bloxels = bloxels.reduce((acc, b) => {
                let id = `${b.x}x${b.y}`;
                if (acc[id]) {
                    if (b.seq == acc[id].seq) {
                        acc[id] = (b.offset - acc[id].offset) > 0 ? acc[id] : b;
                    } else if (b.seq > acc[id].seq) {
                        acc[id] = b;
                    }
                } else {
                    acc[id] = b;
                }
                return acc;
            }, {});
            bloxels = Object.values(bloxels);
            done(bloxels);
        });
    },

    getBloxel(x, y, done) {
        let query = `SELECT * FROM bloxels WHERE x=${x} AND y=${y} ORDER BY seq ASC, offset DESC`;
        page.cmd("dbQuery", [query], function(bloxels) {
            bloxels = bloxels.filter(b => checkBloxel(b));

            let fBlockchain = page.blockchain.bloxels.filter(e => { return e.x == x && e.y == y });
            bloxels = bloxels.concat(fBlockchain);

            let cmp = function(x, y) {
                return x > y ? 1 : x < y ? -1 : 0;
            };

            bloxels.sort((a, b) => {
                return cmp(
                    [cmp(a.seq, b.seq), -cmp(a.offset, b.offset)],
                    // inverse
                    [cmp(b.seq, a.seq), -cmp(b.offset, a.offset)]
                )
            });


            done(bloxels.pop());
        });
    },

    getJsonId(file_name, done) {
        let query = `SELECT json_id FROM json WHERE file_name="${file_name}"`;
        page.cmd("dbQuery", [query], function(res) {
            done(res.pop());
        });
    }
}



