function* mine(bloxel) {

    let dif = calc_dif(bloxel);
    console.log("dif:", dif)
    let solution = "";
    let seed = "";
    let dif_string = "0".repeat(parseInt(dif));
    let timestamp = +new Date();
    var sha = new Hashes.SHA256();
    bloxel.nonce = 0;

    console.log(`Mining block ${bloxel.x}x${bloxel.y} with dif ${dif_string}`);
    seed = getSeed(bloxel);
    bloxel.solution = sha.hex(seed);

    while (bloxel.solution.substr(0, dif) != dif_string) {
        yield bloxel;
        bloxel.nonce += 1;
        seed = getSeed(bloxel);
        bloxel.solution = sha.hex(seed);
    }

    if (!checkBloxel(bloxel)) {
        console.warn("he generado un bloque invalido ", bloxel);
    }

    return bloxel;
}

function getSeed(b) {
    return `${b.x}x${b.y}/${b.color}/${b.user}/${b.time}/${b.offset}/${b.seq}/${b.nonce}/${b.parent}`;
}

var BLOXELS_CHECK_CACHE = new Map();

function checkBloxel(bloxel) {
    let seed = getSeed(bloxel);
    if (BLOXELS_CHECK_CACHE.has(seed)) return BLOXELS_CHECK_CACHE.get(seed);

    //let b = JSON.parse(JSON.stringify(bloxel));

    // check dif criteria
    let dif = calc_dif(bloxel);
    let dif_string = "0".repeat(parseInt(dif));
    if (bloxel.solution.substr(0, dif) != dif_string) {
        console.error("BLOXEL DIF CRITERIA FAILED", b);
        return false;
    }

    if (bloxel.time > +new Date()) {
        console.error("BLOXEL TIME IN THE FUTURE", b);
        return false;
    }

    let sha = new Hashes.SHA256();
    let ret = (bloxel.solution == sha.hex(seed));
    BLOXELS_CHECK_CACHE.set(seed, ret);
    return ret;
}

function backgroundMiner(bloxel, done) {
    var mining = mine(bloxel);
    var stop = false;
    var listeners = {};
    var difficulty = calc_dif(bloxel);

    function emit(...args) {
        Object.values(listeners).forEach(l => l(...args))
    }

    function iter() {
        if (stop) {
            emit("stop");
            return false;
        }
        let b = mining.next();
        //if (b.value.solution) emit("progress", b.value.solution.substr(0, difficulty))
        if (b.value.nonce % 100 == 0) {
            emit("progress", b.value.nonce);
        }

        if (b.done) {
            emit("done", b);
            listeners = {};
            return done(null, b.value);
        }
        return setTimeout(iter, 1)
    }

    return {
        start: function() {
            emit("start");
            return iter();
        },
        stop: function() { stop = true },
        registerListener: (k, l) => {
            listeners[k] = l;
        },
        removeListener: (k) => {
            console.log(listeners)
            delete listeners[k];
            console.log(listeners)
        }
    }
}

function calc_dif(bloxel) {
    let d = 24 * 3600000 / bloxel.offset;
    return d.toFixed();
}



