var Miner = function(bloxel, options) {
    var key = `${bloxel.x}x${bloxel.y}`;
    var bgMiner = null;
    var nonce = 0;
    var best = 0;
    let now = +new Date();
    let d = 24 * 3600000 / (now - options.parent.time);

    function cancelMining(e) {
        bgMiner.stop();
    }

    return {
        id: key,
        start: function() {
            bgMiner = backgroundMiner(bloxel, (err, result) => {
                bgMiner = null;
                page.setBloxel(bloxel, () => {
                    status.removeMiner(this);
                    canvas.refresh();
                    return page.cmd("wrapperNotification", ["info", "Mining compete for bloxel " + bloxel.x + "x" + bloxel.y, 10000]);
                });
            });
            bgMiner.registerListener(key, (e, ...args) => {
                if (e == "stop") {
                    bgMiner.removeListener(key);
                    status.removeMiner(this);
                }
                if (e == "progress") {
                    nonce = args[0];
                    projector.scheduleRender();
                }
            })
            return bgMiner.start();
        },
        renderMaquette: function() {

            return h("div.miner", { key: key }, [
                h('p.text', {}, `Minting ${bloxel.x}x${bloxel.y}`),
                h('p.text', {}, `Dif: ${d.toFixed()}`),
                h('p.text', {}, `Nonce: ${nonce}`),
                h("img", { src: options.img }),
                h("a.cancel.text", { onclick: cancelMining }, "cancel")
            ]);
        }
    }
}



